  return (
    <div className="subcontent card">
      <h1>{title}</h1>
      <h1>{desciption}</h1>
    </div>
  );
}

const Experience = () => {
  const cards = JSON.parse("../assets/portfolio.json");

    return (
      <section className="page" id="experience">
        <header className="App-header">
          <h3>
            Experience
          </h3>
        </header>
        <div className="content experience">
          {cards.map(Card)}
        </div>
      </section>
    );
  }
  
  export default Experience;
